#include <bits/stdc++.h>
using namespace std;
// Node structure
struct Node
{
    int data;
    Node* next;
};

// Function to insert a node at the appropriate position in sorted order
void insertSorted(Node*& head, int value) {
    Node *now = new Node;
    now->data = value;
    now->next = head;
    head = now;
    while(now->next != nullptr){
        if(now->data > now->next->data){
            swap(now->data, now->next->data);
        }
        now = now->next;
    }
}

// Function to delete the first occurrence of a node with the given value
void deleteNode(Node*& head, int value) {
    if(head==nullptr)return ;
    if(head->data==value){
        head = head->next;
        return;
    }
    Node *now = head;
    bool flag=0;
    while(now->next!= nullptr){
        if(now->next->data == value){
            flag=1;
            now->next = now->next->next;
            return;
        }
        now = now->next;
    }
    if(!flag)cout<<"value doesn't exit!\n";
}

// Function to print the current content of the linked list
void printList(Node* head) {
    if(head==nullptr)return;
    do{
        cout<<head->data<<" ";
        head = head->next;
    }while(head != nullptr);
    cout<<'\n';
}
//DO NOT MODIFY THE MAIN() CODE
int main() {
    Node* head = nullptr;

    int mode, value;

    while (true) {
        cin >> mode;
        switch (mode) {
            case 1:
                cin >> value;
                insertSorted(head, value);
                printList(head);
                break;

            case 2:
                cin >> value;
                deleteNode(head, value);
                printList(head);
                break;

            case 3:
                return 0;

            default:
                cout << "Invalid choice. Please try again." << endl;
                break;
        }
    }
    return 0;
}

